import React,{useEffect, useState} from 'react';
import{Redirect, Link} from "react-router-dom";
// import Avatar from '@material-ui/core/Avatar';
import { FormControl, Grid, Input ,Paper, FormGroup, Avatar, TextField, Button, Typography, makeStyles } from "@material-ui/core"
import IconButton from '@material-ui/core/IconButton';
// import DeleteIcon from '@material-ui/icons/Delete';
import CreateIcon from '@material-ui/icons/Create';
import axios from 'axios';

const useStyles = makeStyles  ({
    logg : {
     color: 'blue', 
     textDecoration : 'none',
     fontSize: 20,
     marginLeft:10
    }
  })

  const paperStyle={padding :20, height:'40vh',width:300, margin:"20px auto"}
  const classes= useStyles;




function Home({authorized}){
    const [user, setUser]= useState({});

    useEffect(() => {

        // axios.get('http://192.168.0.238/api/users/me').then((response)=> {
            // console.log("me", response);
        //   })

        const data = JSON.parse(localStorage.getItem('username'));
        console.log('userdata', data);
        setUser(data)

    }, [])


    return (
        <div>
        <Grid>
       <Paper elevation={10} style={paperStyle}>

         <Grid align='center'>
         <Avatar src="/broken-image.jpg" />
      <h2> my profile </h2>
{/* <h3>Name: {user.name}</h3> */}
<form>
  <label>


    <input value={user.name} type="text" name="name"  />
    <IconButton aria-label="create">
  <CreateIcon />
</IconButton>

  </label>

  <label>

    <input value={user.password} type="password" name="password"/>
    <IconButton aria-label="create">
  <CreateIcon />
</IconButton>


  </label>

  </form>


<Typography>
          <Link  className={classes.logg} to="/login"> 
          Logout 
         </Link>
        </Typography>

      </Grid>
      </Paper>
      </Grid>
        </div>

    );
}

export default Home
